description:
Wed Feb 25 2009

64 kbps - volume adjusted


Alex continues his coverage of the Tenth Amendment issue. He welcomes to the show Oklahoma senator Randy Brogdon, who has sponsored SJR 10, legislation asserting state sovereignty. 

Alex also talks with Asia Times Online writer and researcher, F. William Engdahl, author of A Century of War: Anglo-American Oil Politics and the New World Order.


